package Sah::Schema::language::code;

use strict;
use Locale::Codes::Language_Codes ();

our $AUTHORITY = 'cpan:PERLANCAR'; # AUTHORITY
our $DATE = '2023-08-07'; # DATE
our $DIST = 'Sah-Schemas-Language'; # DIST
our $VERSION = '0.005'; # VERSION

my $codes = [];
my $names = [];
{
    for my $alpha2 (keys(%{ $Locale::Codes::Data{'language'}{'code2id'}{'alpha-2'} })) {
        push @$codes, $alpha2;
        my $id = $Locale::Codes::Data{'language'}{'code2id'}{'alpha-2'}{$alpha2}[0];
        push @$names, $Locale::Codes::Data{'language'}{'id2names'}{$id}[0];
    }
    for my $alpha3 (keys(%{ $Locale::Codes::Data{'language'}{'code2id'}{'alpha-3'} })) {
        push @$codes, $alpha3;
        my $id = $Locale::Codes::Data{'language'}{'code2id'}{'alpha-3'}{$alpha3}[0];
        push @$names, $Locale::Codes::Data{'language'}{'id2names'}{$id}[0];
    }

    die "Can't extract country codes from Locale::Codes::Language_Codes"
        unless @$codes;
}

our $schema = [str => {
    summary => 'Language code (alpha-2 or alpha-3)',
    description => <<'_',

Accept only current (not retired) codes. Alpha-2 or alpha-3 codes are accepted.

_
    match => '\A[a-z]{2,3}\z',
    in => $codes,
    'x.in.summaries' => $names,
    'x.perl.coerce_rules' => ['From_str::to_lower'],

    examples => [
        {value=>"", valid=>0},
        {value=>"id", valid=>1, summary=>"Indonesian (2 letter)"},
        {value=>"IND", valid=>1, validated_value=>"ind", summary=>"Indonesian (3 letter)"},
        {value=>"qqq", valid=>0, summary=>"Unknown language code"},
    ],

}, {}];

1;
# ABSTRACT: Language code (alpha-2 or alpha-3)

__END__

