=head1 NAME

Sah::Schema::language::code - Language code (alpha-2 or alpha-3)

=head1 VERSION

This document describes version 0.005 of Sah::Schema::language::code (from Perl distribution Sah-Schemas-Language), released on 2023-08-07.

=head1 SYNOPSIS

=head2 Sample data and validation results against this schema

 ""  # INVALID

 "id"  # valid (Indonesian (2 letter))

 "IND"  # valid (Indonesian (3 letter)), becomes "ind"

 "qqq"  # INVALID (Unknown language code)

=head2 Using with Data::Sah

To check data against this schema (requires L<Data::Sah>):

 use Data::Sah qw(gen_validator);
 my $validator = gen_validator("language::code*");
 say $validator->($data) ? "valid" : "INVALID!";

The above validator returns a boolean result (true if data is valid, false if
otherwise). To return an error message string instead (empty string if data is
valid, a non-empty error message otherwise):

 my $validator = gen_validator("language::code", {return_type=>'str_errmsg'});
 my $errmsg = $validator->($data);
 
 # a sample valid data
 $data = "id";
 my $errmsg = $validator->($data); # => ""
 
 # a sample invalid data
 $data = "";
 my $errmsg = $validator->($data); # => "Must be one of [\"km\",\"nn\",\"vo\",\"fa\",\"rm\",\"en\",\"aa\",\"oc\",\"mr\",\"ab\",\"tn\",\"lu\",\"oj\",\"cy\",\"sv\",\"lt\",\"sl\",\"tr\",\"lb\",\"la\",\"jv\",\"ps\",\"nr\",\"pi\",\"bm\",\"dv\",\"mn\",\"or\",\"af\",\"ny\",\"ff\",\"ht\",\"ie\",\"tk\",\"ty\",\"ha\",\"cr\",\"su\",\"av\",\"lv\",\"ja\",\"st\",\"id\",\"bh\",\"da\",\"be\",\"my\",\"vi\",\"sa\",\"mk\",\"gd\",\"hu\",\"qu\",\"pl\",\"nd\",\"sw\",\"mh\",\"fo\",\"si\",\"zh\",\"ss\",\"ee\",\"sg\",\"ne\",\"lo\",\"kk\",\"ky\",\"ik\",\"th\",\"te\",\"hi\",\"bn\",\"ch\",\"ce\",\"pt\",\"ho\",\"kr\",\"kj\",\"li\",\"pa\",\"gn\",\"lg\",\"as\",\"so\",\"fi\",\"rn\",\"om\",\"br\",\"ug\",\"kn\",\"ms\",\"ku\",\"ng\",\"iu\",\"mi\",\"se\",\"sh\",\"ru\",\"de\",\"ba\",\"tg\",\"gu\",\"ts\",\"sq\",\"co\",\"ti\",\"am\",\"ia\",\"he\",\"ka\",\"tw\",\"it\",\"os\",\"es\",\"ga\",\"sd\",\"mg\",\"eo\",\"no\",\"to\",\"wa\",\"cs\",\"sm\",\"gv\",\"gl\",\"ae\",\"kl\",\"kv\",\"nv\",\"el\",\"hz\",\"bo\",\"nl\",\"sr\",\"ay\",\"cu\",\"tl\",\"ak\",\"fy\",\"yo\",\"xh\",\"sc\",\"sn\",\"dz\",\"ko\",\"io\",\"ml\",\"hr\",\"ca\",\"ro\",\"uk\",\"bg\",\"ks\",\"ii\",\"ur\",\"ki\",\"rw\",\"is\",\"et\",\"zu\",\"hy\",\"wo\",\"nb\",\"ta\",\"kw\",\"tt\",\"az\",\"na\",\"an\",\"ve\",\"ln\",\"fr\",\"za\",\"ar\",\"yi\",\"sk\",\"cv\",\"eu\",\"mt\",\"kg\",\"bs\",\"fj\",\"bi\",\"ig\",\"uz\",\"itb\",\"loj\",\"kjm\",\"bis\",\"rir\",\"vmz\",\"mun\",\"dks\",\"bgv\",\"anr\",\"zrp\",\"cax\",\"mlg\",\"cui\",\"gwr\",\"kro\",\"skv\",\"cat\",\"ach\",\"tkw\",\"kek\",\"kwc\",\"aup\",\"kwh\",\"bin\",\"nuv\",\"mtv\",\"xyl\",\"sxe\",\"mli\",\"yly\",\"nyw\",\"mus\",\"ilb\",\"aeb\",\"yua\",\"ukh\",\"bgi\",\"skg\",\"mnw\",\"nat\",\"tuz\",\"bwg\",\"mtg\",\"brj\",\"cuv\",\"nug\",\"pes\",\"cts\",\"sea\",\"ski\",\"bgg\",\"til\",\"bcd\",\"ctn\",\"mpd\",\"paf\",\"nui\",\"kmw\",\"wwr\",\"mlv\",\"aeu\",\"mti\",\"ilu\",\"bwi\",\"yty\",\"ipk\",\"nax\",\"prl\",\"itz\",\"vmb\",\"ymd\",\"auj\",\"pkr\",\"ylr\",\"pom\",\"aqr\",\"cpe\",\"rga\",\"zcd\",\"xak\",